script: |
  super -f text -I q1085.spq | sort > q1085.out

inputs:
  - name: q1085.spq
    data: |
      SELECT DISTINCT col0 AS col2 FROM tab1 (FORMAT parquet) cor0 WHERE ( col2 ) IS NOT NULL AND NOT ( + + 16 ) < - col2 - ( + 85 );
  - name: tab1

outputs:
  - name: q1085.out
    data: |
      51
      85
      91
